import React from "react";
import PlaneService from "../services/PlaneService";

class InfoPlaneComponent extends React.Component {

    constructor(props){
      super(props)
        this.state = {
          planes:[]
        }
      this.loadData = this.loadData.bind(this);
    }

    componentDidMount(){
      this.loadData();
      setInterval(this.loadData, 10000);
    }

    async loadData() {
        try {
            PlaneService.getPlanesIpEntry().then((response) => {
                this.setState({
                planes: response.data
            })
        });
        } catch (e) {
            console.log(e);
        }
    }

    render(){
      return(
        <div>
        <h3 className="text-left"> PLANE <b color="danger">XPTO</b> OVER IBERIAN PENINSULA </h3>
          <p><b>Icao: </b> </p>
            <p><b>Callsign: </b> </p>
            <p><b>Origin Country: </b> </p>
            <p><b>Time position: </b> </p>
            <p><b>Longitude: </b> </p>
            <p><b>Latitude: </b> </p>
            <p><b>Altitude: </b> </p>
            <p><b>Velocity: </b> </p>
        </div>
      )
    }
}

export default InfoPlaneComponent
